import './Landing.css';
import React from 'react';
import SimpleAppBar from './components/SimpleAppBar';
import {background, secondary} from './components/colors';

function Landing() {
    return (
      <React.Fragment>
        <SimpleAppBar />
        <span sx={{background: background}}>
        <div className="Landing" >sx={{background: background}}
            <p>
              E
            </p>
        </div>
        <div>
            <p>
              Contact
            </p>
        </div>
        </span>
      </React.Fragment>
    );
  }
  
  export default Landing;
